import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

import axios from 'axios';
import deleteVehicle from './DeleteVehicle';

export default function AllVehicle() {
  const [vehicle, setVehicles] = useState([]);

  const getVehicle = () => {
    axios.get('http://localhost:6060/Vehicle/')
      .then((res) => {
        console.log(res.data);
        setVehicles(res.data);
      })
      .catch((err) => {
        alert(err.message);
      });    
      
  };

  

  useEffect(() => {
    getVehicle();
    
  }, []);

  const handleDelete = (vehicleId) => {
    deleteVehicle(vehicleId)
      .then(() => {
        alert('Vehicle deleted successfully');
        getVehicle();
      })
      .catch((err) => {
        alert('Vehicle not deleted: ' + err);
      });
  };

  

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', height: '100vh', backgroundColor: '#f0f0f0' }}>
  <h1 style={{ marginLeft: '-200px' }}>All Vehicles</h1>
  <div style={{ width: '90%', overflowX: 'auto' }}>
    <table style={{ borderCollapse: 'collapse', width: '100%', border: '1px solid #ddd', borderRadius: '5px', tableLayout: 'fixed' }}>
      <thead style={{ backgroundColor: '#f0f0f0', borderBottom: '2px solid #ddd', display: 'block' }}>
        <tr style={{ display: 'flex' }}>
          <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd', flex: '1' }}>Reg Number</th>
          <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd', flex: '1' }}>Brand</th>
          <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd', flex: '1' }}>Model</th>
          <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd', flex: '1' }}>Available</th>
          <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd', flex: '1' }}>Price Per Day</th>
          <th style={{ padding: '5px', textAlign: 'center', borderBottom: '1px solid #ddd', flex: '0.5' }}>View</th>
          <th style={{ padding: '5px', textAlign: 'center', borderBottom: '1px solid #ddd', flex: '0.5' }}>Delete</th>
          <th style={{ padding: '5px', textAlign: 'center', borderBottom: '1px solid #ddd', flex: '0.5' }}>Update</th>
        </tr>
      </thead>
      <tbody style={{ display: 'block', maxHeight: '400px', overflowY: 'auto' }}>
        {vehicle.map((v, index) => (
          <tr key={index} style={{ display: 'flex', borderBottom: '1px solid #ddd' }}>
            <td style={{ padding: '12px', flex: '1' }}>{v.regnumber}</td>
            <td style={{ padding: '12px', flex: '1' }}>{v.brand}</td>
            <td style={{ padding: '12px', flex: '1' }}>{v.model}</td>
            <td style={{ padding: '12px', flex: '1' }}>{v.available}</td>
            <td style={{ padding: '12px', flex: '1' }}>Rs: {v.priceperday}</td>
            <td style={{ padding: '5px', textAlign: 'center', flex: '0.5' }}>
              <img
                src={`http://localhost:6060/images/eye.png`}
                alt={`${index}`}
                style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer', marginRight: '5px' }}
                onClick={() => handleDelete(v._id)}
              />
            </td>
            <td style={{ padding: '5px', textAlign: 'center', flex: '0.5' }}>
              <img
                src={`http://localhost:6060/images/delete.png`}
                alt={`${index}`}
                style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer', marginRight: '5px' }}
                onClick={() => handleDelete(v._id)}
              />
            </td>
            <td style={{ padding: '5px', textAlign: 'center', flex: '0.5' }}>
              <a className="nav-link" href={`/update/${v._id}`}>
                <img
                  src={`http://localhost:6060/images/edit.png`}
                  alt={`${index}`}
                  style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer' }}
                />
              </a>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
</div>



  );
}
